import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Nav, Tab } from "react-bootstrap";
import Header from "../layout/header";
import Footer from "../layout/footer";
import Brand1 from "../element/brand1";

const aboutbg = require("./../../assets/images/background/image-11.jpg");
const touchbg = require("./../../assets/images/background/image-8.jpg");

class CasesGrid extends Component {
  render() {
    return (
      <>
        <Header />
        {/* <!-- Page Banner Section --> */}
        <section class="page-banner">
          <div
            className="page-banner-bg"
            style={{ backgroundImage: "url(" + aboutbg + ")" }}
          ></div>
          <div class="bottom-rotten-curve alternate"></div>

          <div class="auto-container">
            <h1>Cases</h1>
            <ul class="bread-crumb clearfix">
              <li>
                <Link to={"/#"}>Home</Link>
              </li>
              <li class="active">Cases</li>
            </ul>
          </div>
        </section>
        {/* <!--End Banner Section --> */}

        <div class="row align-items-center" style={{ width: "10%" }}>
          <div class="col-lg-5">
            <div class="image">
              {/* <img
                src={require("../../assets/images/resource/image-18.jpg")}
                alt=""
              /> */}
              <div>Omar Sameh Ali</div>
            </div>
          </div>
          <div class="col-lg-5">
            <div class="content pl-lg-4">
              <div class="sec-title">
                <div class="sub-title">Get Rewards</div>
                <h2>
                  Just Proved Our Selves <br />
                  For Great Works.
                </h2>
              </div>
              <div class="text">
                Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do
                eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut
                enim ad minim veniam, quis nostrud exercitation ullamco laboris
                nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor
                in reprehenderit in voluptate velit esse cillum.
              </div>
              <div class="link-btn">
                <Link to={"/#"} class="theme-btn btn-style-one">
                  <span class="btn-title">Learn More</span>
                </Link>
              </div>
            </div>
          </div>
        </div>
      </>
    );
  }
}
export default CasesGrid;
